import axios from "axios";

export const init = () => {
  axios.interceptors.response.use(
    (res) => {
      return res;
    },
    (e) => {
      if (e.response.status === 401) {
        // status가 401일 경우 핸들링 처리
        return e.response;
      } else {
        return e;
      }
    }
  );

  alert("IN");
};
